import React, { Component } from 'react';
import Navibar from "../Coponent/Navibar";
import Axios from 'axios';

export default class Orders extends Component {
    constructor(props) {
        super(props)
        this.state = {
            reply:[]
        }
    }
    getData(){
        console.log(this.props.user.uid)
        var url="http://127.0.0.1:8081/v2/booking/user?uid="
        url+=this.props.user.uid
        console.log(url)
        Axios.get(url)
            .then(res=>{
                console.log("res:",res.data);
                this.setState({
                    reply:res.data
                })
            });   
    }
    render() {
        return (
            <div className="order">
                <Navibar loggedinstatus={this.props.loggedinstatus} />
                <div className="order_container">
                    <button className="order_button" onClick={()=>this.getData()}>
                        your orders
                    </button>
                    <div >
                        {this.state.reply.map((detail,index) => {
                            return <div className="s_div">
                                <div>
                                    <h3>Order </h3>
                                    <p className="di">{index}</p>
                                </div>
                                <div>
                                    <h3>Roome id </h3>
                                    <p className="di">{detail.rid}</p>
                                </div>
                            </div>
                        })}

                    </div>
                </div>
            </div>
        );
    }
}
